<template>
	<view>
		<view class="photo">
			<!-- <image v-if="img_url" :src="img_url" mode="aspectFit" style="width:500rpx"> </image>-->
			<canvas v-if="img_url" class="canvas_color" canvas-id="canvas_color" id="canvas_color" @touchstart="tStart"
				@touchmove="tMove" @touchend="tEnd" @longtap="tLong">
			</canvas>
			<canvas v-if="img_url" class="canvas_preview" canvas-id="canvas_preview" id="canvas_preview">
			</canvas>
			<view v-else class="uni-flex uni-column">
				<image src="@/static/image/placeholder.png" style="width:384.62rpx;height:384.62rpx;margin: auto;">
				</image>
				<text style="color: #f74d6b;font-size: 50rpx;font-weight: 500;">暂无图片</text>
			</view>
		</view>
		<view class="color-resv" v-if="resList.length > 0">
			<v-tabs v-model="current" :tabs="tabs" color="#fff" activeColor="#f7d7dd" bgColor="rgb(0,0,0,0.5)"
				lineColor="#f74d6b" @change="changeTab"></v-tabs>

			<view class="tab-v">
				<view class="uni-flex uni-column color-resi">
					<view v-for="(item,index) in resList" :key="index" @click="goDetail(item)"
						class="uni-flex uni-column color-v">
						<view class="color-card" :style="item.bkgColor">
							<text class="color-id">{{'#'+item.lipId}}</text>
							<text class="color-name">{{item.lipName}}</text>
							<text class="color-mv">{{'相似度：'+item.matchVal+'%'}}</text>
						</view>
					</view>
				</view>
			</view>
		</view>
		<!-- 占位 -->
		<view v-else class="color-resvn"></view>

		<view>
			<button class="chose-but" @click="chooseMedia">请选择一张照片</button>
			<!-- <button class="chose-but" @click="" style="margin-top:10px">查看色号全景图</button> -->
		</view>

	</view>

</template>

<script>
	export default {
		data() {
			return {
				img_url: '',
				img_width: 0,
				img_height: 0,
				windowWidth: 0,
				img_dx: 0,
				selectedColor: '',
				current: 0,
				tabs: [],
				resList: [],
				resListLength: 3, // 返回的参考色值的数量
				lipstick: [{
						'name': '迪奥',
						'index': 1
					},
					{
						'name': '阿玛尼',
						'index': 2
					},
					{
						'name': '兰蔻',
						'index': 3
					},
					{
						'name': '圣罗兰',
						'index': 4
					},
					{
						'name': '美宝莲',
						'index': 5
					},
					{
						'name': '纪梵希',
						'index': 6
					},
					{
						'name': '香奈儿可可小姐',
						'index': 7
					},
				]
			}
		},
		onLoad() {
			this.stop();
			this.tabs = [];
			for (let i = 0, len = this.lipstick.length; i < len; i++) {
				this.tabs.push(this.lipstick[i].name);
			}
		},
		onReady() {},
		onShow() {},
		mounted() {},
		onHide() {},
		methods: {
			gotoVis() {
				// uni.navigateTo({
				// 	url: 'lip_vis'
				// });
			},
			chooseMedia() {
				let t = this;
				// 微信小程序使用
				// uni.chooseMedia({
				// 	count: 1,
				// 	mediaType: ['image'],
				// 	sourceType: ['album', 'camera'],
				// 	camera: 'back',
				// 	success(res) {
				// 		let path = res.tempFiles[0].tempFilePath;
				// 		t.img_url = path
				// 		t.getImageInfo(path)
				// 	}
				// })

				uni.chooseImage({
					count: 1,
					sizeType: ['original'], //可以指定是原图还是压缩图，默认二者都有
					sourceType: ['album', 'camera'], //从相册选择
					success: function(res) {
						let path = res.tempFilePaths[0];
						t.img_url = path
						uni.getImageInfo({
							src: path,
							success: function(image) {
								t.img_width = 250 * image.width / image.height;
								t.img_height = 250;
								t.windowWidth = uni.getSystemInfoSync().windowWidth;
								t.img_dx = t.windowWidth / 2 - t.img_width / 2;

								var ctx = uni.createCanvasContext('canvas_color');
								ctx.drawImage(path, t.img_dx, 0, t.img_width, t.img_height)
								ctx.draw();
								// 清空预览
								var canvp = uni.createCanvasContext('canvas_preview');
								canvp.draw();
							}
						});

					}
				});
			},
			tEnd(data) {
				// console.log('end')
				// console.log(this.selectedColor, 'selectedColor')
				// this.diffColor(this.selectedColor, this.current + 1)
			},
			drawCircle(data, color) {
				let width = this.img_width;
				let height = this.img_height;
				let windowWidth = this.windowWidth
				// console.log(width, 'width')
				// console.log(height, 'height')
				// console.log(windowWidth, 'windowWidth')
				let bx = windowWidth / 2 - width / 2 + 2;
				let ex = windowWidth / 2 + width / 2 - 2;
				let by = 0;
				let ey = 250;
				// console.log(bx, 'bx')
				// console.log(ex, 'ex')
				if (data.touches[0].x < bx || data.touches[0].x > ex) {
					return;
				}
				if (data.touches[0].y < by || data.touches[0].y > ey) {
					return;
				}
				var ctx = uni.createCanvasContext('canvas_color');
				let r = 20;
				let x, y;
				let edge = false;
				if (data.touches[0].x < bx + 30) {
					edge = true;
					x = data.touches[0].x + 35
				}
				// if (data.touches[0].x > (ex - 30)) {
				// 	edge = true;
				// 	x = data.touches[0].x - 35
				// }
				if (!edge) {
					x = data.touches[0].x - 35
				}
				y = data.touches[0].y - 10

				// 画图片
				ctx.drawImage(this.img_url, this.img_dx, 0, this.img_width, this.img_height)

				// 画预览
				let ix = data.touches[0].x - (this.windowWidth / 2 - this.img_width / 2);
				if (ix < 30) {
					ix = 30;
				}
				let iy = data.touches[0].y
				if (iy < 30) {
					iy = 30;
				}
				var canvp = uni.createCanvasContext('canvas_preview');
				canvp.drawImage(this.img_url, -ix + 30, -iy + 30, this.img_width, this.img_height)
				// 画预览的圆点
				canvp.beginPath()
				canvp.arc(30, 30, 3, 0, 2 * Math.PI)
				canvp.setFillStyle('#43f794')
				canvp.fill()
				canvp.draw();

				// 填充色
				ctx.arc(x, y, r, 0, 2 * Math.PI)
				ctx.setFillStyle(color)
				ctx.fill()

				// 边框
				ctx.beginPath()
				ctx.arc(x, y, r, 0, 2 * Math.PI)
				ctx.setStrokeStyle('#fff')
				ctx.lineWidth = 2
				ctx.stroke()
				ctx.draw();
				this.selectedColor = color;
				this.diffColor(this.selectedColor, this.current + 1)
			},
			tStart(data) {
				// console.log(data, 'tStart')
				this.imgColor(data);
			},
			tMove(data) {
				// console.log(data, 'tMove')
				this.imgColor(data);
			},
			tLong(data) {
				// console.log(data, 'tLong')
				this.imgColor(data);
			},
			imgColor(data) {
				const t = this;
				uni.canvasGetImageData({
					canvasId: 'canvas_color',
					x: data.touches[0].x,
					y: data.touches[0].y,
					width: 2,
					height: 2,
					success(res) {
						t.drawCircle(data, t.rgb2Hex(res.data.slice(0, 3)))
					}
				})
			},
			rgb2Hex(c) {
				return "#" + this.colorToHex(c[0]) + this.colorToHex(c[1]) + this.colorToHex(c[2]);
			},
			colorToHex(color) {
				var hexadecimal = color.toString(16);
				return hexadecimal.length == 1 ? "0" + hexadecimal : hexadecimal;
			},
			goDetail(item) {
				console.log(item, '当前色值')
			},
			changeTab(index) {
				if (!this.selectedColor) {
					uni.showToast({
						title: '请先取色',
						icon: 'none'
					});
					return;
				}
				this.diffColor(this.selectedColor, index + 1);
			},
			diffColor(hex, index) {
				let resList = [];
				let data = require('@/data/lipstick_' + index + '.json')
				let series = data.series;
				for (let i = 0, ilen = series.length; i < ilen; i++) {
					const s = series[i];
					const seriesName = s.name;
					const lipsticks = s.lipsticks;
					for (let m = 0, mlen = lipsticks.length; m < mlen; m++) {
						const l = lipsticks[m];
						const id = l.id;
						const name = l.name;
						const color = l.color ? l.color : '#ffa502';
						let dd = this.deltaE(this.hex2rgb(hex), this.hex2rgb(color));
						let v = (100 - dd).toFixed(2);
						let resName = seriesName + (name ? ('-' + name) : '');
						resList.push({
							'lipName': resName,
							'lipId': id,
							'lipColor': color,
							'bkgColor': 'background-color:' + color,
							'matchVal': v
						})
					}
				}
				resList.sort((a, b) => {
					return b.matchVal - a.matchVal
				})
				if (resList.length > this.resListLength) {
					this.resList = resList.slice(0, this.resListLength)
				} else {
					this.resList = resList;
				}
			},
			deltaE(rgbA, rgbB) {
				let labA = this.rgb2lab(rgbA);
				let labB = this.rgb2lab(rgbB);
				let deltaL = labA[0] - labB[0];
				let deltaA = labA[1] - labB[1];
				let deltaB = labA[2] - labB[2];
				let c1 = Math.sqrt(labA[1] * labA[1] + labA[2] * labA[2]);
				let c2 = Math.sqrt(labB[1] * labB[1] + labB[2] * labB[2]);
				let deltaC = c1 - c2;
				let deltaH = deltaA * deltaA + deltaB * deltaB - deltaC * deltaC;
				deltaH = deltaH < 0 ? 0 : Math.sqrt(deltaH);
				let sc = 1.0 + 0.045 * c1;
				let sh = 1.0 + 0.015 * c1;
				let deltaLKlsl = deltaL / (1.0);
				let deltaCkcsc = deltaC / (sc);
				let deltaHkhsh = deltaH / (sh);
				let i = deltaLKlsl * deltaLKlsl + deltaCkcsc * deltaCkcsc + deltaHkhsh * deltaHkhsh;
				return i < 0 ? 0 : Math.sqrt(i);
			},
			rgb2lab(rgb) {
				let r = rgb[0] / 255,
					g = rgb[1] / 255,
					b = rgb[2] / 255,
					x, y, z;
				r = (r > 0.04045) ? Math.pow((r + 0.055) / 1.055, 2.4) : r / 12.92;
				g = (g > 0.04045) ? Math.pow((g + 0.055) / 1.055, 2.4) : g / 12.92;
				b = (b > 0.04045) ? Math.pow((b + 0.055) / 1.055, 2.4) : b / 12.92;
				x = (r * 0.4124 + g * 0.3576 + b * 0.1805) / 0.95047;
				y = (r * 0.2126 + g * 0.7152 + b * 0.0722) / 1.00000;
				z = (r * 0.0193 + g * 0.1192 + b * 0.9505) / 1.08883;
				x = (x > 0.008856) ? Math.pow(x, 1 / 3) : (7.787 * x) + 16 / 116;
				y = (y > 0.008856) ? Math.pow(y, 1 / 3) : (7.787 * y) + 16 / 116;
				z = (z > 0.008856) ? Math.pow(z, 1 / 3) : (7.787 * z) + 16 / 116;
				return [(116 * y) - 16, 500 * (x - y), 200 * (y - z)]
			},
			hex2rgb(hex) {
				let m = hex.match(/^#?([\da-f]{2})([\da-f]{2})([\da-f]{2})$/i);
				return [
					parseInt(m[1], 16),
					parseInt(m[2], 16),
					parseInt(m[3], 16)
				];
			},
			stop() {
				var box = function(e) {
					passive: false;
				};
				document.body.style.overflow = 'hidden';
				document.addEventListener("touchmove", box, false);
			},
		},
	}
</script>

